Серьезно. 
Никаких расследований о Путине и его бабле в фбк Навального.

@Форма Воды Я работаю фельдшером (PA) в Комнате Неотложной Помощи (ER) в  относительно небольшом госпитале в штате НЙ недалеко от города НЙ (около 45 миль).
Нас COVID-19 не ударил настолько сильно как госпиталя в NYC, и сейчас ситуация намного лучше, но 4 недели назад около 90% от всех наших пациентов были пациенты с COVID-19, и вместо одного обычного ICU (Отдел Интенсивной Терапии) у нас было 3 где, на обычный день, было 40- 45 он интубированных пациентов с уровнем смертельности у которых был как минимум 80%. Трак холодильник около морга стоит до сих пор. 
Я повторюсь, сейчас ситуация намного лучше с только 10-15% пациентов от общих имеющих COVID.
